import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Form, Button, InputGroup, Alert } from "react-bootstrap";
import { RootState } from "../store"; // Adjust the import based on your project structure

const Login = () => {
  const [email, setEmail] = useState<string>("");
  const [password, setPassword] = useState<string>("");
  const [rememberMe, setRememberMe] = useState<boolean>(false);
  const [errors, setErrors] = useState<{ email: string; password: string }>({
    email: "",
    password: "",
  });
  const [isClick, setIsClick] = useState<boolean>(false);

  const dispatch = useDispatch();
  const auth = useSelector((state: RootState) => state.auth);

  useEffect(() => {
    const rememberMe = localStorage.getItem("rememberMe") === "true";
    const email = rememberMe ? localStorage.getItem("email") || "" : "";
    const password = rememberMe ? localStorage.getItem("password") || "" : "";
    setEmail(email);
    setPassword(password);
    setRememberMe(rememberMe);
  }, []);

  const handleChange = (
    event: React.ChangeEvent<HTMLInputElement>
  ) => {
    const { name, value, type, checked } = event.target;
    if (type === "checkbox") {
      setRememberMe(checked);
    } else {
      if (name === "email") setEmail(value);
      if (name === "password") setPassword(value);
    }
    setErrors((prevErrors) => ({
      ...prevErrors,
      [name]: "",
    }));
  };

  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    const data = {
      email: email.trim().toLowerCase(),
      password,
      rememberMe,
    };

    const loginValidator = (data: typeof data) => {
      // validation logic here
      return {
        isValid: true,
        errors: {},
      };
    };

    const { isValid, errors } = loginValidator(data);
    if (isValid) {
      setIsClick(true);
      dispatch({ type: "LOGIN_REQUEST", payload: data }); // Adjust action type and payload as per your project
    } else {
      setErrors(errors);
    }
  };

  return (
    <div
      className="container d-flex justify-content-center align-items-center"
      style={{ height: "100vh" }}
    >
      <div
        className="card p-4 shadow-lg w-100"
        style={{
          maxWidth: "400px",
          height: "400px",
          marginBottom: "150px",
          marginTop: "0px",
        }}
      >
        <h5 className="text-center mb-4">Login</h5>
        <Form onSubmit={handleSubmit}>
          <Form.Group controlId="formBasicEmail" className="mb-3">
            <InputGroup>
              <input
                type="text"
                name="email"
                value={email}
                className={`form-control ${errors.email ? "is-invalid" : ""}`}
                placeholder="Email Address"
                onChange={handleChange}
              />
              {errors.email && (
                <div className="invalid-feedback">{errors.email}</div>
              )}
            </InputGroup>
          </Form.Group>
          <Form.Group controlId="formBasicPassword" className="mb-3">
            <InputGroup>
              <input
                type="password"
                name="password"
                value={password}
                className={`form-control ${
                  errors.password ? "is-invalid" : ""
                }`}
                placeholder="Password"
                onChange={handleChange}
              />
              {errors.password && (
                <div className="invalid-feedback">{errors.password}</div>
              )}
            </InputGroup>
            {!auth.isLoggedIn && isClick && auth.error ? (
              <Alert variant="danger" className="mt-3">
                {auth.error}
              </Alert>
            ) : null}
          </Form.Group>
          <div className="form-group mb-3">
            <Button type="submit" className="btn btn-primary w-100 login-btn">
              Login
            </Button>
          </div>
          <div className="d-flex justify-content-between align-items-center mt-3">
            <Form.Check
              type="checkbox"
              name="rememberMe"
              checked={rememberMe}
              onChange={handleChange}
              id="custom-checkbox"
              label="Remember me"
            />
            <span
              onClick={() => dispatch({ type: "FORGOT_PASSWORD" })} // Adjust action type as per your project
              className="text-primary cursor-pointer"
            >
              Forgot Password?
            </span>
          </div>
        </Form>
      </div>
    </div>
  );
};

export default Login;
